        if 0 <= x < W and 0 <= y < H:
            return True
        else:
            return False

    def w_and_h_of_vertex(x,y):
        return W*y + x, H*x + y

    def dfs(x,y,current_cut,current_area):
        if (x,y) == (0,0) or (is_on_border(x,y) or current_cut <= current_area or current_cut > current_area):
            return False

        x1,y1 = w_and_h_of_vertex(x,y)

        x2,y2 = w_and_h_of_vertex(x + 1,y)

        if x2 == x1 or y2 == y1:
            return False

        x3,y3 = w_and_h_of_vertex(x + 1,y + 1)

        if y3 == y2 or x3 == x2:
            return False

        current_cut = current_cut + 1

        x_prev,y_prev = x2,y2
        x_next,y_next = x3,y3

        if current_cut < current_area:
            return dfs(x_prev,y_prev,current_cut,current_area)
        else:
            return dfs(x_next,y_next,current_cut,current_area)

    if is_on_border(0,0):
        return "0"

    res = 0
    if dfs(0,0,0,0) == False:
        return "0"

    while dfs(0,0,0,res) == False:
        res += 1

